class App extends Component {
    constructor(props) {
        super(props);
        this.state = { 'title': 'Hello React' };
    }
    render() {
        return (
            <section className='flex justify-center'>
                <div>
                    <div>{this.state.title}</div>
                </div>
            </section>
        );
    }
}


export default App;
